INSERT INTO `info_pengembangan` (`id`, `judul`, `deskripsi`, `tanggal`, `status`) VALUES
(1, 'Peningkatan Validasi Input NIP dan NIK pada Usulan Mutasi', '<p data-start=\"168\" data-end=\"459\">Sebelum pengembangan, input NIP dan NIK tidak memiliki validasi yang ketat sehingga memungkinkan pengguna memasukkan data yang tidak sesuai format atau mengajukan usulan dengan data yang sudah ada dalam proses. Hal ini berpotensi menyebabkan duplikasi atau kesalahan data.</p><p data-start=\"461\" data-end=\"753\">Setelah pengembangan, sistem telah menerapkan validasi ketat:<br data-start=\"522\" data-end=\"525\"> NIP harus terdiri dari&nbsp;<span data-start=\"550\" data-end=\"568\" style=\"font-weight: bolder;\">18 digit angka</span><br data-start=\"568\" data-end=\"571\"> NIK harus terdiri dari&nbsp;<span data-start=\"596\" data-end=\"614\" style=\"font-weight: bolder;\">16 digit angka</span><br data-start=\"614\" data-end=\"617\" data-is-only-node=\"\"> Hanya angka yang dapat dimasukkan (tidak bisa huruf atau karakter lain)<br data-start=\"690\" data-end=\"693\"> Cek ketersediaan NIP/NIK untuk mencegah duplikasi usulan</p><p data-start=\"755\" data-end=\"943\"><img src=\"https://blogger.googleusercontent.com/img/b/R29vZ2xl/AVvXsEiiQKoiUCCLBm62MOZdUE9rWu-75cSGugvShVeYYuOEenvJFsIB_4jipaIfY5ZOqXipbxDP11FV85H3rl-c_6V4IfedMW2pij7mvqmCffvTMjlsYyu4VStnM521O3W_mafiEEjkwv0l9KFXA54_J_UzuGuX1uAydcwxl45Nc3KXTivmesI/s1600/usulan-validasi-nik-nip.png\" style=\"width: 50%;\"><span data-start=\"755\" data-end=\"767\" style=\"font-weight: bolder;\"><br></span></p><p data-start=\"755\" data-end=\"943\"><span data-start=\"755\" data-end=\"767\" style=\"font-weight: bolder;\">Manfaat:</span><br data-start=\"767\" data-end=\"770\"> Memastikan keakuratan data guru dalam sistem<br data-start=\"816\" data-end=\"819\"> Mencegah pengajuan usulan ganda dengan data yang sama<br data-start=\"874\" data-end=\"877\"> Mengurangi kesalahan input yang dapat menghambat proses mutasi</p>', '2025-03-04 10:12:46', 'public'),
(2, 'Optimalisasi Proses Input Usulan Mutasi Guru', '<p data-start=\"156\" data-end=\"409\">Sebelum pengembangan, proses input usulan dilakukan dalam satu halaman yang mencakup input data guru, sekolah, serta berkas usulan. Hal ini meningkatkan risiko kesalahan penyimpanan data akibat beban input yang besar dalam satu tahap.</p><p data-start=\"411\" data-end=\"574\">Setelah pengembangan, proses input usulan dioptimalkan menjadi dua tahap:<br data-start=\"484\" data-end=\"487\">1<span data-start=\"491\" data-end=\"502\" style=\"font-weight: bolder;\">Tahap 1</span> Input data guru dan sekolah<br data-start=\"532\" data-end=\"535\" data-is-only-node=\"\">2<span data-start=\"539\" data-end=\"550\" style=\"font-weight: bolder;\">Tahap 2</span> Input berkas usulan</p><p data-start=\"576\" data-end=\"777\" style=\"text-align: center; \"><img src=\"https://blogger.googleusercontent.com/img/b/R29vZ2xl/AVvXsEiUvxBJQhj9XzcBz8jeDMuvqTh4UfE4cg3KrO4xRLwuyMUR3_MyXR5eVA1lEsXuLalbkZhrXA4nU8rSMoR-080DddI9bMv_WfpyeRmGyq1eY1i53spalpJM_fc5PKcTBAQ1CfiKziQnLVCEL2fGeGFIXwzpUaiRxbQV4_ee6IHGWXlmEEo/s1600/usulan-tahap1.png\" style=\"width: 50%;\"></p><p data-start=\"576\" data-end=\"777\" style=\"text-align: center; \"><img src=\"https://blogger.googleusercontent.com/img/b/R29vZ2xl/AVvXsEgvg4SLGUn-XBdgTlnPvd8JDT1pQdzClInttGoPXd4rv2pX8v-kqRtydxF8i7-izej7rSesHrhXJnPTAYnQjXafIqSnrtajBsIrfKOvtMW7YH36Xm4O1tbjMsqifcKnZERerDZ9IAUwc4Hne0KiWlD7uHmyZxVgXm3iQwqfRI7SDoxXeWY/s1600/usulan-tahap2.png\" style=\"width: 50%;\"><span data-start=\"576\" data-end=\"588\" style=\"font-weight: bolder;\"><br></span></p><p data-start=\"576\" data-end=\"777\"><span data-start=\"576\" data-end=\"588\" style=\"font-weight: bolder;\">Manfaat:</span><br data-start=\"588\" data-end=\"591\"> Meminimalkan risiko kesalahan dalam penyimpanan data<br data-start=\"645\" data-end=\"648\"> Mempermudah validasi dan koreksi sebelum mengunggah berkas<br data-start=\"708\" data-end=\"711\" data-is-only-node=\"\"> Meningkatkan kecepatan dan efisiensi dalam proses input usulan</p>', '2025-03-05 10:13:09', 'public'),
(3, 'Fitur Info Pengembangan dan Video Tutorial', '<p>Sekarang, pengguna dapat melihat daftar perubahan dan peningkatan fitur langsung di dalam aplikasi melalui menu sebalah kiri</p><p>Menu:</p><p>&nbsp;<strong data-start=\"288\" data-end=\"322\">Informasi  Info Pengembangan</strong>.</p><p>&nbsp;<span data-start=\"288\" data-end=\"322\" style=\"font-weight: bolder;\">Informasi  Video Tutorial <i>(dalam proses)</i></span>.</p><p><strong data-start=\"327\" data-end=\"339\">Manfaat:</strong><br data-start=\"339\" data-end=\"342\"> Memudahkan pengguna mengetahui fitur baru<br data-start=\"385\" data-end=\"388\"> Meningkatkan pemahaman terhadap sistem<br data-start=\"428\" data-end=\"431\"> Mengurangi pertanyaan berulang</p>', '2025-03-06 10:17:09', 'public'),
(4, 'Alur Proses Mutasi Guru pada SIMUTASI', '<p>Berikut file PDF paparan alur proses Sistem Informasi Mutasi Guru (SIMUTASI) Dinas Pendidikan Aceh.&nbsp;<b><a href=\"https://drive.google.com/file/d/1v6hCIOn2c46jrSCoI9O1qOBUPrVovdV9/view?usp=drive_link\" target=\"_blank\">Paparan_SIMUTASI.PDF</a></b></p>', '2025-03-06 16:58:41', 'public'),
(5, 'Penambahan Halaman Helpdesk', '<p data-start=\"70\" data-end=\"143\"> <strong data-start=\"73\" data-end=\"141\">Fitur Baru: Halaman Helpdesk Urusan Mutasi Dinas Pendidikan Aceh</strong></p><p data-start=\"145\" data-end=\"437\">Sekarang, operator Cabang Dinas Pendidikan Wilayah Kabupaten/Kota dapat mengakses informasi kontak helpdesk urusan mutasi melalui halaman Helpdesk.</p><p data-start=\"145\" data-end=\"437\"><span style=\"font-size: 1rem;\">&nbsp;</span><span data-start=\"288\" data-end=\"322\" style=\"font-size: 1rem; font-weight: bolder;\">Informasi  Helpdesk</span><span style=\"font-size: 1rem;\">.</span></p><p data-start=\"145\" data-end=\"437\"> </p><p data-start=\"145\" data-end=\"437\">Fitur ini berguna untuk memudahkan komunikasi terkait aplikasi SIMUTASI antara Operator Cabang Dinas dengan Tim GTK Dinas Provinsi Aceh sesuai dengan <span data-start=\"397\" data-end=\"406\">DAPIL</span>&nbsp;(wilayah) masing-masing .</p><p data-start=\"439\" data-end=\"706\">Dengan adanya halaman ini, diharapkan proses konsultasi dan penyelesaian kendala terkait mutasi dapat berjalan lebih cepat dan efisien.</p>', '2025-03-07 09:41:29', 'public'),
(6, 'Perbaikan Fitur Pemilihan Kabupaten Asal pada Usulan Mutasi', '<p>Dalam rangka meningkatkan kemudahan dan akurasi pengisian data pada fitur Tambah Usulan Mutasi, telah dilakukan penyesuaian mekanisme pemilihan Kabupaten Asal. Berikut adalah perubahan yang diterapkan:</p><p>Kabupaten Asal sekarang harus dipilih oleh pengguna, tidak lagi otomatis terisi, Daftar Kabupaten Asal hanya menampilkan kabupaten yang sesuai dengan Cabang Dinas pengguna, Cabang Dinas Asal akan diperbarui otomatis berdasarkan Kabupaten Asal yang dipilih, Dropdown Sekolah Asal tetap menampilkan sekolah sesuai dengan Kabupaten Asal yang dipilih, Kabupaten Tujuan tetap bisa dipilih secara bebas, dan Cabang Dinas Tujuan diperbarui secara otomatis.</p><p>Dengan perubahan ini, pengguna memiliki kontrol penuh dalam memilih Kabupaten Asal, sementara sistem tetap memastikan validasi data sesuai aturan.</p>', '2025-03-10 09:39:41', 'public');
