(19, 'CD006202503030001', 'emyr1409@gmail.com', 'Aplikasi ini sangat membantu khususnya bagi ASN yang sedang dan atau akan mengajukan mutasi/relokasi dilingkungan pemerintah aceh. Ini merupakan satu terobosan yang sangat baik dalam upaya pelayanan birokrasi yang transparan serta efisien. Dalam penggunaannya sangat mudah namun dirasa perlu di lengkapi fitur tambahan yang lebih menarik seperti  helpdesk, QnA dan ragam lainnya. Selebihnya sudah sangat bagus sekali.', 'Terimakasih atas masukkan. Kami akan terus melakukan pengembangan aplikasi ini untuk memenuhi kebutuhan guru dalam melakukan usulan mutasi', 'Sudah Dibalas', '2025-03-21 05:12:01', '2025-03-23 18:10:47'),
(20, 'CD006202503030001', 'emyr1409@gmail.com', 'Aslmkm, izin bertanya pd pihak berwenang apakah setelah di level 5 pada stts pengajuan, berkas nota dinas yang d unduh sudah di anggap resmi dan berlaku utk di gunakan sebagaimana isi dalam surat tsb?\r\nMhn informasinya, trm ksh ??\r\n', 'Nota Dinas sudah diterbitkan. terimakasih', 'Sudah Dibalas', '2025-04-08 13:32:56', '2025-05-22 18:59:28'),
(22, 'CD019202503180001', 'mujihadin.kabu87@gmail.com', 'Assalamu\'alaikum Bpk/ibu untuk perbaikan Anjab saya sudah saya kirim kepada admin di kabupaten yaitu Pak Heksa wuriono, apakah sudah diupload untuk perbaikan Anjab saya itu. Terimakasih', NULL, 'Belum Dibalas', '2025-04-23 00:37:55', '2025-04-23 00:37:55'),
(23, 'CD004202505230001', 'ruslanjamil45@gmail.com', 'Mohon di proses usulan ini lebih cepat supaya bisa masuk mengajar pada tahun ajaran baru', NULL, 'Belum Dibalas', '2025-05-30 08:09:26', '2025-05-30 08:09:26'),
(24, 'CD016202506190001', 'sundari57@guru.sma.belajar.id', 'Bapak Mohon untuk terealisasi segera Nota Dinas Atas Nama Saya Sundari dari SMAN 1 DARUL MAKMUR Nagan Raya Ke SMAN 1 LHOKSUKON ACEH UTARA.', NULL, 'Belum Dibalas', '2025-06-19 18:30:51', '2025-06-19 18:30:51'),
(25, 'CD016202506190001', 'sundari57@guru.sma.belajar.id', 'Lebih cepat diproses setiap berkas yang sudah di Agendakan di Disdik dalam kurun waktu minimal kurang dari 2 pekan\r\nMemberikan timbal balik dengan komunikasi yang baik dengan para Pegawai yang mengalami pengurusan terkait Mutasi', NULL, 'Belum Dibalas', '2025-06-24 04:24:58', '2025-06-24 04:24:58'),
