(27, 'CD016202506190001', 'sundari57@guru.sma.belajar.id', 'Lebih cepat diproses setiap berkas yang sudah di Agendakan di Disdik dalam kurun waktu minimal kurang dari 2 pekan\r\nMemberikan timbal balik dengan komunikasi yang baik dengan para Pegawai yang mengalami pengurusan terkait Mutasi', 'Terima ksih saran dan masukkannya,,,,nsyaallah kami akan selalu berusaha yang terbaik...', 'Sudah Dibalas', '2025-06-24 04:24:58', '2025-08-22 02:32:17'),
(28, 'CD019202506030002', 'sahibulfajri97@gmail.com', 'Diharapkan untuk Proses Verifikasi di percepat & yang masa kerja nya sudah 10 Tahun mengabdikan diri bisa di pertimbangkan berkas mutasinya.', NULL, 'Belum Dibalas', '2025-06-25 07:46:57', '2025-06-25 07:46:57'),
