(31, 'CD004202505230001', 'ruslanjamil45@gmail.com', 'Mohon pengusulan pindah saya atas nama Ruslan Jamil, dari SMA N 1 Bireuen ke SMA N 14 Banda Aceh bisa di lanjutkan prosesnya. ?', 'Insyaallah kalau syarat dan analisisnya sudah sesui, prosesnya tetap berlanjut', 'Sudah Dibalas', '2025-07-23 00:11:43', '2025-08-22 02:35:33'),
(32, 'CD015202507080001', 'dasniaulia@gmail.com', 'Mohon infonya progres mutasi secara berkala. Terimakasih.', 'Bisa ditraking prosesnya di aplikasi si mutasi ini', 'Sudah Dibalas', '2025-08-14 16:39:16', '2025-08-22 02:33:18'),
(34, 'CD018202508140001', 'evisartika77@gmail.com', 'Semoga Nota Dinasnya segera keluar', 'Insyaallah kalau syarat dan bahan sudah lengkap pasti segera keluar...', 'Sudah Dibalas', '2025-08-17 16:02:21', '2025-08-22 02:30:15'),
(35, 'CD020202505220001', 'nurrahmi04621@gmail.com', 'Mohon agar proses mutasi pegawai dapat dipercepat, khususnya bagi yang telah melengkapi persyaratan administrasi dan memiliki alasan mendesak seperti pertimbangan keluarga maupun jarak domisili. Percepatan ini akan membantu kelancaran kinerja serta mendukung peningkatan pelayanan pendidikan.', 'Terima kasih atas masukkannya...insyaallah kami tidak memperlambat proses, dan selalu berusaha secepatnya, namun kami butuh analisis mendalam dan banyaknya berkas yang masuk sehingga prosesya menbbutuhkan waktu..mohon bersabar ya...', 'Sudah Dibalas', '2025-08-18 11:11:18', '2025-08-22 02:29:18'),
(36, 'CD005202507170001', 'evidianti8383@ gmail.com', 'Mohon proses mutasinya lebih cepat dari tahun-tahun yang lalu.Terimakasih', 'Terima kasih atas sarannya, insyaallah kita akan selalu berusaha melayani GTK lebih baik dari tahun ke tahun', 'Sudah Dibalas', '2025-08-20 21:44:36', '2025-08-22 02:25:56'),
