(551, 'Yuslinar, S.Pd', '198307032009042007', '1114044502720001', 'SMA NEGERI 1 CALANG', 'SMK NEGERI 1 PANGA', 'Mendamping suami yang pindah tugas\r\nKelebihan guru Bahasa Indonesia di SMA Negeri 1 Calang\r\nBerdomisili dan keluarga di ladang baro,Kec Panga Kab Aceh Jaya', NULL, 'CD014202602090001', '02', 'mutasi_tetap', '2026-02-09 08:23:06', '2026-02-13 01:17:33', 17, NULL, NULL, NULL),
(552, 'Eka Nasrianty, S.Pd', '199108282019032008', '1173016808910001', 'SMAN 2 PANTE BIDARI', 'SMA NEGERI 3 SAMALANGA', '1. Anak membutuhkan pengobatan dan terapi rutin setiap bulan yang memerlukan pendampingan kedua orang tua dan tidak dapat di tangani sendiri.\r\n2. Mengikuti suami yang bertugas sebagai pegawai negeri Sipil (PNS) di Kecamatan Ulim.\r\n3. SMA Negeri 3 Samalanga masih kekurangan Guru PNS matetika.\r\n4. Untuk memennuhi jam Sertifikasi.', NULL, 'CD007202602100001', '02', 'mutasi_tetap', '2026-02-10 02:42:18', '2026-02-09 21:16:18', 10, NULL, NULL, NULL),
(554, 'Nur Aidar', '197508142005042001', '1107175408750001', 'SMAN 2 INDRAJAYA', 'SMAN 1 SAKTI', 'Jumlah jam tidak mencukupi dan jauh dari tempat tinggal', NULL, 'CD003202602100001', '01', 'mutasi_tetap', '2026-02-10 06:18:58', '2026-02-10 06:18:58', 6, NULL, NULL, NULL),
