(558, 'DESI WILDAYANI, S.Pd', '199205122019032016', '1114045205920001', 'SMK NEGERI 1 CALANG', 'SMA NEGERI 1 DARUL HIKMAH', 'Telah Melaksanakan Tugas Sebagai guru Nota Dinas mata pelajaran Biologi Di SMA Negeri 1 Darul Hikmah dari tahun 2022 sampai dengan Sekarang \r\nMemiliki Peran Penting di SMA Negeri 1 Darul Hikmah Yaitu sebagai Wakil Kepala Bagian Sarana dan Prasarana\r\nDisekolah SMK Negeri 1 Calang 0 jam Pelajaran Biologi \r\n0Jarak tempuh dari rumah kesekolah SMK Negeri 1 Calang Terlalu jauh yaitu 60 Km \r\n', NULL, 'CD014202602110001', '02', 'mutasi_tetap', '2026-02-11 02:43:37', '2026-02-13 01:15:02', 17, NULL, NULL, NULL),
(559, 'FIKA SANDARI, S.Pd', '199607032019032010', '1101054307960001', 'SMK NEGERI 1 PASIE RAYA', 'SMAN 1 LABUHAN HAJI BARAT', 'karena jauh dari suami dan menjaga orang tua (Ibu) yang sedang dalam kondisi sakit. \r\n', NULL, 'CD014202602110002', '02', 'mutasi_tetap', '2026-02-11 04:08:45', '2026-02-13 01:13:37', 17, NULL, NULL, NULL),
(561, 'MISWAR, S.Pd', '198704232023211017', '1118012304870001', 'SMA NEGERI 1 JAYA', 'SMAN 2 MEUREUDU', '1. Ingin berkumpul dengan keluarga (Ismail dan anak)\r\n2. Jarak penempatan yang jauh dari tempat keluarga\r\n3. Ingin Meurawat Orang Tua', NULL, 'CD014202602120001', '02', 'nota_dinas', '2026-02-12 02:40:17', '2026-02-13 03:19:53', 17, NULL, NULL, NULL),
(562, 'SANTI SIAHAAN, S.E', '198401022022212012', '1106104201840001', 'SMKN 1 SABANG', 'SMA NEGERI 1 KUTA BARO', '1. Berdasarkan analisa Jabatan guru akuntansi di SMK Negeri 1 Sabang lebih 1 orang.\r\n2. Dibutuhkan Guru Ekonomi di SMA Negeri 1 Kuta Baro\r\n', NULL, 'CD002202602120001', '04', 'nota_dinas', '2026-02-12 03:13:21', '2026-02-12 07:51:32', 5, NULL, NULL, NULL),
(563, 'ZAINUDDIN, S.Pd', '199001232023211015', '1108142301900001', 'SMKN 1 LABUHANHAJI', 'SMK NEGERI 1 BAKTIYA', 'Jauh dari tempat tinggal lebih kurang 19 (sembilan belas) jam perjalanan, Kelebihan guru di sekolah penempatan dan dibutuhkan di sekolah tujuan.', NULL, 'CD018202602120001', '02', 'nota_dinas', '2026-02-12 08:17:01', '2026-02-12 02:29:40', 22, NULL, NULL, NULL),
