(566, 'Suhaimi, S.Pd', '198205252009041010', '1171092505820005', 'SMA NEGERI 2 SAMPOINIET', 'SMA NEGERI KEULUANG', '1. Keluarga (Istri ) Mempunyai penyakit kronis \r\n2. Berdomisili di Banda Aceh, Dekat Jangkauan Pulang \r\n3. Ingin mengabdi dan ikut memajukan sekolah SMA Negeri Keuluang ', NULL, 'CD014202602130001', '02', 'mutasi_tetap', '2026-02-13 08:27:43', '2026-02-13 01:44:22', 17, NULL, NULL, NULL),
(567, 'SAUDAH, S.Pd', '197911042009042003', '1107074411790001', 'SMA NEGERI 2 SAMPOINIET', 'SMAN 2 INDRAJAYA', '1. Jumlah jam yang tidak mencukupi di sekolah asal \r\n2. Ingin merawat orang tua yang sudah uzur dan sakit-sakitan \r\n', NULL, 'CD014202602130002', '02', 'mutasi_tetap', '2026-02-13 09:00:02', '2026-02-13 02:06:55', 17, NULL, NULL, NULL),
(568, 'SUPARTY LUBIS, SP', '197009152006042002', '1114015509700001', 'SMK NEGERI 1 PANGA', 'SMK NEGERI 1 DARUL HIKMAH', '1. Nota Dinas pada SMK Negeri 1 Darul Hikmah, Kabupaten Aceh Jaya terhitung dari 18 Januari 2022 (Mutasi Kepala Sekolah). \r\n2. Mata pelajaran Kejuruan Agribisnis Tanaman Pangan dan Hortikultura ada di SMK Negeri 1 Darul Hikmah, Kabupaten Aceh Jaya \r\n3. ikut suami yang bertugas dan tinggal di Kecamatan Darul Hikmah.\r\n', NULL, 'CD014202602130003', '02', 'mutasi_tetap', '2026-02-13 09:19:33', '2026-02-13 04:53:01', 17, NULL, NULL, NULL),
