(570, 'KRIFLI, S.Pd', '199102032023211012', '1101110302910001', 'SMAN UNGGUL TAPAKTUAN', 'SMK NEGERI 1 KLUET TIMUR', 'Jauh dari tempat tinggal kurang lebih 35 km, tidak ada jam di sekolah penempatan dan dibutuhkan di sekolah tujuan.', NULL, 'CD018202602180001', '02', 'nota_dinas', '2026-02-18 07:47:23', '2026-02-18 01:01:00', 22, NULL, NULL, NULL);
